        <notes>This SPrO variable refers to the resource specified by the object property 'has associated instance resource [input_A]' that links it to an entry component. The resource is linked to an entry component and with it implicitely also to all its child components using this object property. This way, the resource is held available for the case that it must be referred to in some other context.%nl;%nl;Therefore, if the current entry component has no associated resource, one must trace the composition-tree upward, and check the sequence of parent components whether one of them has a resource associated. The first associated resource found when applying this procedure is the resource to which this SPrO variable refers to.%nl;%nl;%nl;Side note: An instance resource associated to a child entry component takes precedence over any instance resource associated to one of its parent components!</notes>
